INSERT INTO `product_type` (`pdt_name`) VALUES
('Tea break'),
('Bánh truyền thống');

INSERT INTO `product` (`pd_name`, `pd_price`, `pd_description`, `pdt_id`, `pd_image`) VALUES
('Mousse Trà Xanh',
  '25000',
  'Bánh mousse trà xanh là một món tráng miệng thanh lịch và tinh tế. Với lớp mousse trà xanh mịn màng, hương vị thơm lừng của bột matcha kết hợp cùng vị ngọt dịu, bánh mang đến cảm giác thư thái và dễ chịu. Bánh mousse trà xanh thường được trang trí bằng các loại trái cây tươi hoặc bột matcha, tạo nên một tác phẩm nghệ thuật đẹp mắt và hấp dẫn.',
  6,
  ),
('Mousse Chanh Dây',
  '25000',
  'Bánh mousse chanh dây là một món tráng miệng thanh mát, hấp dẫn. Với lớp mousse chanh dây chua ngọt, béo mịn kết hợp cùng đế bánh giòn tan, bánh mang đến hương vị độc đáo, khó quên. Bánh không chỉ đẹp mắt mà còn rất dễ làm, phù hợp cho những buổi tiệc hoặc đơn giản là để thưởng thức tại nhà.',
  6,
  ),
('Mousse Socola',
  '25000',
  'Bánh mousse socola là sự kết hợp hoàn hảo giữa vị đắng nhẹ của socola và độ béo ngậy của kem tươi. Lớp kem mousse mềm mịn, tan chảy trong miệng, tạo cảm giác thật thư giãn. Bánh thường được trang trí đơn giản với bột cacao hoặc vài lát trái cây tươi, nhưng vẫn đủ sức chinh phục mọi thực khách. Mousse socola là món tráng miệng lý tưởng cho những buổi tiệc hoặc đơn giản chỉ để thưởng thức sau bữa ăn.',
  6,
  ),
('Bánh Chuối Thốt Nốt',
  '6000',
  'Bánh chuối thốt nốt là một món ăn truyền thống đậm đà hương vị miền Tây. Với lớp vỏ bánh mềm dẻo, nhân chuối chín ngọt ngào quyện cùng vị thơm đặc trưng của đường thốt nốt, bánh mang đến một trải nghiệm ẩm thực khó quên. Món bánh này không chỉ là món ăn vặt mà còn là niềm tự hào của người dân miền Tây. Bạn có muốn biết cách làm bánh chuối thốt nốt không?',
  7,
  ),
('Bánh Da Lợn',
  '7000',
  'Bánh da lợn là một món tráng miệng truyền thống của Việt Nam, đặc biệt phổ biến ở miền Nam. Với lớp vỏ trong suốt, nhiều màu sắc bắt mắt và nhân đậu xanh béo ngậy, bánh da lợn không chỉ là món ăn ngon mà còn là một tác phẩm nghệ thuật ẩm thực. Món bánh này thường được thưởng thức vào những dịp lễ, Tết hoặc trong các bữa ăn gia đình, mang đến hương vị thơm ngon và niềm vui cho mọi người.',
  7,
  ),
('Bánh Bò Nước Cốt Dừa',
  '3000',
  'Bánh bò nước cốt dừa là món ăn truyền thống của Việt Nam, đặc biệt phổ biến ở miền Nam. Với hương vị thơm béo của nước cốt dừa, kết hợp cùng phần bánh mềm xốp, bánh bò nước cốt dừa là món tráng miệng hoặc ăn sáng vô cùng hấp dẫn. Bánh có màu trắng sữa, bề mặt mịn màng, khi ăn có vị ngọt thanh, béo ngậy. Bánh bò nước cốt dừa thường được ăn kèm với nước cốt dừa béo ngậy hoặc nước đường để tăng thêm hương vị.',
  7,
  ),
('Bánh Bò Đường Thốt Nốt',
  '3000',
  'Bánh bò đường thốt nốt là một đặc sản của vùng đất Tây Nam Bộ, đặc biệt là An Giang. Với hương vị thơm lừng của đường thốt nốt hòa quyện cùng vị béo ngậy của nước cốt dừa, bánh bò mang đến một trải nghiệm ẩm thực khó quên. Những chiếc bánh với những lỗ tổ ong nhỏ li ti, mềm mịn, dai dai, là món ăn sáng hoặc tráng miệng tuyệt vời. Bánh bò đường thốt nốt không chỉ ngon miệng mà còn mang đậm nét văn hóa ẩm thực của vùng đất này.',
  7,
  ),
('Bánh Bò Lá Dứa',
  '3000',
  'Bánh bò lá dứa là một món ăn truyền thống của Việt Nam, được yêu thích bởi hương thơm đặc trưng của lá dứa và vị ngọt thanh. Cốt bánh mềm mịn, dai dai, kết hợp với màu xanh bắt mắt của lá dứa tạo nên một món ăn hấp dẫn. Bánh bò lá dứa thường được thưởng thức cùng với nước cốt dừa béo ngậy, làm tăng thêm hương vị thơm ngon.',
  7,
  );